import React from "react";
import axios from "axios";
const App = () => {
  const Http = axios.create({
    baseURL: "https://jsonplaceholder.typicode.com/users/",
  });

  const config = {
    params: {
      id: 1,
    },
  };
  Http.get("/", config).then((res) => {
    console.log(res.data);
  });

  return <h1>Axios</h1>;
};

export default App;
